import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, View, Dimensions } from 'react-native';
import { 
  Provider as PaperProvider,
  DarkTheme,
  Appbar,
  Text, 
  Surface
} from 'react-native-paper';
import CelebrityCard from "./components/CelebrityCard.js";

const theme = {
  ...DarkTheme,
  colors: {
    ...DarkTheme.colors,
    surface: "rgb(40, 40, 40)"
  },
  adaptive: true,
}

const persons = [
  {
    name: "Donald Trump",
    image: require('./assets/trump_512x512.png'),
  },
  {
    name: "Kim Kardashian",
    image: require('./assets/kim_kardashian_512x512.png'),
  }
];

export default function App() {
  return ( 
    <PaperProvider theme={theme}>
      <Appbar.Header style={{elevation: 4}}>
        <Appbar.Content title="Select a Voice"/>
      </Appbar.Header>
      <View style={styles.container}>
        <View style={styles.celebrityCardWrapper}>
          <CelebrityCard name="Donald Trump" image={trumpImage}/>
        </View>
        <StatusBar style="auto" />
      </View>
    </PaperProvider>
  );
}

const styles = StyleSheet.create({
  container: { 
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#121212",
    minHeight: Dimensions.get('window').height
  },
  celebrityCardWrapper: {
    paddingLeft: 16,
    paddingRight: 16
  }
});
